import React, { Component } from 'react'
import './../App.css';
import TextField from '@material-ui/core/TextField';
import Button from '@material-ui/core/Button';
import PostFormLocation from './PostFormLocation';
import ShowLocation from './ShowLocation';
import GetMyLocation from './GetMyLocation';
import CheckLocation from './CheckLocation';
export default class homscreens extends Component {
    render() {
        return (
            <div className="App">
                <div style={{paddingTop:20}}>
                    <h1>Check-Location Web App</h1>
                </div>
                <div style={{paddingTop:25}}>
                    <PostFormLocation />
                </div>
                <div className="centered" style={{paddingTop:25}}>
                    <ShowLocation />
                </div>
                <div className="centered" style={{paddingTop:50}}>
                    <GetMyLocation />
                </div>
                <div className="centered" style={{paddingTop:50}}>
                    <CheckLocation />
                </div>
            </div>
        )
    }
}
